window.bookSummaryJSON = "<p><b>From</b><b><i> New York Times</i></b><b> best-selling author Jonathan Maberry (creator of the Netflix series </b><b><i>V Wars</i></b><b>)</b> <b>comes the first in a brand-new series featuring Joe Ledger and Rogue Team International. </b>&nbsp;</p> <p>A small island off the coast of Korea is torn apart by a bioweapon that drives everyone - men, women, and children - insane with murderous rage. The people behind the attack want Korea reunified or destroyed. No middle ground. No mercy.&nbsp;Soon Japan, China, and the United States are pushed to the brink of war, while terrorists threaten to release the rage bioweapon in a way of pure destructive slaughter. Joe Ledger leads his newly formed band of international troubleshooters in their first mission to stop the terror cell, fighting alongside agents from North and South Korea. With the lives of billions at stake, Ledger is willing to bring his own brand of terror to this frightening new war.</p>"; 
